import Login from '../components/Login/Login';

export const BUTTON_TYPES = {
    primary: 'primary',
    link: 'link',
};

export const ROUTES = {
    login: {
        path: '/login',
        component: Login,
    },
    register: {
        path: '/register',
    },
    resetPassword: {
        path: '/reset-password',
    },
    dashboard: {
        path: '/app/dashboard',
    },
};
